(window.webpackJsonp=window.webpackJsonp||[]).push([[7],{236:function(e){e.exports=JSON.parse('{"metadata":{"timed":true,"story ID":"f6bf5d97-b144-4d79-80eb-1c4b4f51146a","title":{"_default":"2016-ADA-indl"},"media":{"audio":"2016-ADA-indl.wav","video":"2016-ADA-indl.mp4"},"languages":[],"date_created":"","date_uploaded":"7/29/2020","source":{"_default":""},"description":"","genre":"","author":"","glosser":"","speakers":[],"xml_file_name":"2016-ADA-indl.eaf","source_filetype":"ELAN","tier IDs":{"Transcription-por":{"name":"Transcription-por","subdivided":false},"Translation-en":{"name":"Translation-en","subdivided":false}},"speaker IDs":{"S1":{"tier":"Transcription-por"},"S2":{"tier":"Translation-en"}}},"sentences":[{"speaker":"S1","tier":"Transcription-por","start_time_ms":4020,"end_time_ms":19490,"num_slots":1,"text":"Bom, gente. Bom dia a todos! Hoje nós estamos aqui com a Fernanda. Ela veio fazer um trabalho a pedido do Dennis (Albert Moore). Não só com os Wajuru, mas com todas as etnias.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":4020,"end_time_ms":19490,"num_slots":1,"text":"Well, people, good morning everyone! Today we are here with Fernanda. She came to do a job at the request of Dennis (Albert Moore). Not only with the Wajuru, but with all ethnicities.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":19990,"end_time_ms":27710,"num_slots":1,"text":"Eu tenho até uma preocupação também de, a cada ano, perder a nossa língua, né?","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":19990,"end_time_ms":27710,"num_slots":1,"text":"I am also concerned about losing our language each year, right?","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":27920,"end_time_ms":33020,"num_slots":1,"text":"Esse ano (2016) foram uns três historiadores nosso embora.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":27920,"end_time_ms":33020,"num_slots":1,"text":"This year (2016), some three of our historians passed away.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":34010,"end_time_ms":42980,"num_slots":1,"text":"Então, cada ano que passa, nos preocupamos com essa parte da nossa cultura, da nossa língua.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":34010,"end_time_ms":42980,"num_slots":1,"text":"So, with each passing year, we care about our culture, our language.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":43980,"end_time_ms":54920,"num_slots":1,"text":"Então o que a gente ainda está querendo é que cada etnia possa ainda resgatar a sua língua, sua cultura.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":43980,"end_time_ms":54920,"num_slots":1,"text":"So what we still want is that each ethnic group can still rescue their language, their culture.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":55410,"end_time_ms":63300,"num_slots":1,"text":"Mas isso depende de cada um de nós porque, se nós não nos preocuparmos com isso, nós não aprendemos a falar nada mais.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":55410,"end_time_ms":63300,"num_slots":1,"text":"But it depends on each one of us because, if we don\'t worry about it, we don\'t learn to say anything else.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":63990,"end_time_ms":71010,"num_slots":1,"text":"Então, hoje, nós estamos com a Fernanda. Faz tempo que a Fernanda está trabalhando com nós.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":63990,"end_time_ms":71010,"num_slots":1,"text":"So, today, we are with Fernanda. Fernanda has been working with us for a long time.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":71180,"end_time_ms":76010,"num_slots":1,"text":"E a gente vê já um pouco de resultado.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":71180,"end_time_ms":76010,"num_slots":1,"text":"And we already see some results.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":76320,"end_time_ms":82290,"num_slots":1,"text":"Eu sei que falar a língua, para a gente, hoje, para o jovem, é meio pesado.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":76320,"end_time_ms":82290,"num_slots":1,"text":"I know that speaking the language, for us today, for young people, is difficult.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":82670,"end_time_ms":88990,"num_slots":1,"text":"Mas, se a gente quiser mesmo falar, a gente consegue.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":82670,"end_time_ms":88990,"num_slots":1,"text":"But, if we really want to speak our language, we can do it.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":89480,"end_time_ms":95530,"num_slots":1,"text":"Eu, tempos atrás, não falava quase nada. Hoje, já falo um pouco mais.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":89480,"end_time_ms":95530,"num_slots":1,"text":"I used to speak almost nothing a long time ago. Today, I speak a little more.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":96000,"end_time_ms":98960,"num_slots":1,"text":"Então, isso não é entrave para ninguém.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":96000,"end_time_ms":98960,"num_slots":1,"text":"So, this is no obstacle for anyone.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":99060,"end_time_ms":107990,"num_slots":1,"text":"Principalmente para o nosso jovem. Eles têm que aproveitar o pouco que nós temos ainda dos nossos velhos.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":99060,"end_time_ms":107990,"num_slots":1,"text":"Mainly for our youth. They have to take advantage of what little we have from our elders.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":108490,"end_time_ms":112050,"num_slots":1,"text":"Nossos historiadores, donos da língua, próprio mesmo.","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":108490,"end_time_ms":112050,"num_slots":1,"text":"Our historians, really owners of the language.","dependents":[]},{"speaker":"S1","tier":"Transcription-por","start_time_ms":112630,"end_time_ms":123030,"num_slots":1,"text":"Então, isso não vai demorar por muito tempo. Nossa preocupação é máxima com a nossa língua materna. ","dependents":[]},{"speaker":"S2","tier":"Translation-en","start_time_ms":112630,"end_time_ms":123030,"num_slots":1,"text":"So, it won\'t take long. We have a huge concern for our mother tongue.","dependents":[]}]}')}}]);